import "./App.css";
import { Modal } from "./Modal.js";
import { Carousel } from "./Carousel.js";
import { RadioButton } from "./RadioButton.js";
function App() {
  return (
    <div className="modal">
      <div>
        <div>
          <Modal side={"What i want to input"}></Modal>
        </div>
        <div>
          <RadioButton></RadioButton>
        </div>
      </div>
      <div>
        <Carousel></Carousel>
      </div>
    </div>
  );
}

export default App;
